import React, { Component } from 'react'

import Msg from '../Msg';

export default class MsgList extends Component {
  
  show = (self)=>{
    return ()=>{
      console.log('hello', self);
    }
  }
  render() {
    return (
      <div>
        <Msg />
        <Msg />
      </div>
    )
  }
}
